import Sidebar from "../../../Component/SideBar/Sidebar";
import AddUser from "./CRUD2/Add/Adduser";

export default function Usermanagement() {
  const [showAddUser, setShowAddUser] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [roleFilter, setRoleFilter] = useState('All Roles');

  const users = [
    { name: 'John Admin', email: 'john@admin.com', role: 'Admin', status: 'active', login: '12/08/2025 10:30 AM', created: '01/08/2025' },
    { name: 'Mike Wilson', email: 'mike@tanker.com', role: 'Tanker', status: 'active', login: '12/08/2025 09:15 AM', created: '02/08/2025' },
    { name: 'Sarah Johnson', email: 'sarah@tanker.com', role: 'Tanker', status: 'active', login: '11/08/2025 04:45 PM', created: '03/08/2025' },
    { name: 'Robert Brown', email: 'robert@tanker.com', role: 'Tanker', status: 'inactive', login: '10/08/2025 02:00 PM', created: '04/08/2025' },
  ];

  const filteredUsers = users.filter(user => {
    const matchesSearch = user.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                          user.email.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesRole = roleFilter === 'All Roles' || user.role === roleFilter;
    return matchesSearch && matchesRole;
  });

  return (
    <div className="container">
      <Sidebar />
      <div className="content">
        {showAddUser ? (
          <AddUser />
        ) : (
          <>
            <div className="header-row">
              <h2>User Management</h2>
              <button className="add-user" onClick={() => setShowAddUser(true)}>+ Add New User</button>
            </div>

            <div className="filter-row">
              <input
                type="text"
                placeholder="Search users by name or email..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
              <select value={roleFilter} onChange={(e) => setRoleFilter(e.target.value)}>
                <option>All Roles</option>
                <option>Admin</option>
                <option>Tanker</option>
              </select>
            </div>

            <table className="table">
              <thead>
                <tr>
                  <th>User</th>
                  <th>Role</th>
                  <th>Status</th>
                  <th>Last Login</th>
                  <th>Created</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {filteredUsers.map((user, index) => (
                  <tr key={index}>
                    <td>
                      <strong>{user.name}</strong><br />
                      <span className="email">{user.email}</span>
                    </td>
                    <td><span className="role">{user.role}</span></td>
                    <td>
                      <span className={user.status === 'active' ? 'active' : 'inactive'}>
                        {user.status}
                      </span>
                    </td>
                    <td>{user.login}</td>
                    <td>{user.created}</td>
                    <td>
                      <button className="edit">‚úèÔ∏è</button>
                      <button className="delete">üóëÔ∏è</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </>
        )}
      </div>
    </div>
  );
}
